import React, { useState, useEffect } from 'react';
import PracticeSection from './components/PracticeSection';
import AIPracticeSection from './components/AIPracticeSection';
import ExamStructureSection from './components/ExamStructureSection';
import PredictionSection from './components/PredictionSection';
import axios from 'axios';
import './App.css';

const API_URL = 'http://localhost:5000/api';

function App() {
  const [selectedSystem, setSelectedSystem] = useState('exam');
  const [selectedCategory, setSelectedCategory] = useState('');
  const [categories, setCategories] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const systems = [
    { id: 'exam', name: '國中會考數學 AI 輔助學習系統' },
    { id: 'subsidy', name: 'AI輔助補助案系統' }
  ];

  useEffect(() => {
    const fetchCategories = async () => {
      try {
        const response = await axios.get(`${API_URL}/categories`);
        setCategories(response.data);
        setLoading(false);
      } catch (err) {
        console.error('Error fetching categories:', err);
        setError('獲取分類失敗：' + err.message);
        setLoading(false);
      }
    };

    fetchCategories();
  }, []);

  const handleSystemChange = (systemId) => {
    setSelectedSystem(systemId);
    setSelectedCategory(''); // 重置分類選擇
  };

  const handleCategoryChange = (event) => {
    setSelectedCategory(event.target.value);
  };

  const renderContent = () => {
    if (selectedSystem === 'subsidy') {
      return (
        <div className="subsidy-system">
          <h2>AI輔助補助案系統</h2>
          <p>此系統正在開發中...</p>
        </div>
      );
    }

    switch (selectedCategory) {
      case 'course-links':
        return <PracticeSection />;
      case 'ai-math':
        return <PracticeSection />;
      case 'exam-structure':
        return <ExamStructureSection />;
      case 'ai-practice':
        return <AIPracticeSection />;
      case 'prediction':
        return <PredictionSection />;
      default:
        return (
          <div className="welcome-box fade-in">
            <div className="welcome-content">
              <img 
                src="https://cdn-icons-png.flaticon.com/512/3135/3135768.png" 
                alt="AI Icon" 
                className="welcome-icon"
              />
              <h2>歡迎使用「國中會考數學 AI 輔助學習系統」</h2>
              <p>
                本系統結合 <span className="highlight">AI 技術</span>，協助你針對會考數學進行練習、分析與規劃。
                <br/>
                請從上方選單選擇你想使用的功能開始探索！
              </p>
            </div>
          </div>
        );
    }
  };

  if (loading) {
    return <div className="loading">載入中...</div>;
  }

  if (error) {
    return <div className="error">{error}</div>;
  }

  return (
    <div className="app">
      <div className="system-switcher">
        {systems.map(system => (
          <button
            key={system.id}
            className={`system-button ${selectedSystem === system.id ? 'active' : ''}`}
            onClick={() => handleSystemChange(system.id)}
          >
            {system.name}
          </button>
        ))}
      </div>

      {selectedSystem === 'exam' && (
        <div className="category-selector">
          <label htmlFor="category">選擇功能：</label>
          <select 
            id="category" 
            value={selectedCategory}
            onChange={handleCategoryChange}
            className="category-select"
          >
            <option value="">--請選擇--</option>
            {categories.map((category) => (
              <option key={category._id} value={category._id}>
                {category.label}
              </option>
            ))}
          </select>
        </div>
      )}

      <div className="content-area">
        {renderContent()}
      </div>
    </div>
  );
}

export default App;
